import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import config from "../config";
import fetchHelper from "../utils/fetchHelper";
import ApiHandler from "./ApiHandlerPage";

export default function Main() {
  const navigate = useNavigate();
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetchHelper(`http://${config.SERVER_URL}/api/main`);
        if (!response.ok) {
          if (response.status === 404) navigate("/error/404");
          else if (response.status === 500) navigate("/error/500");
          else if (response.status === 503) navigate("/error/503");
          throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const result = await response.json();
        setData(result);
      } catch (error) {
        setError("메인 페이지 데이터를 불러오는 중 오류 발생.");
        console.error("메인 페이지 데이터 요청 오류:", error);
      }
    }
    fetchData();
  }, [navigate]);

  return (
    <div>
      <h2>Main Page</h2>
      {error ? <p style={{ color: "red" }}>{error}</p> : <p>데이터를 불러오는 중...</p>}
      {data && <pre>{JSON.stringify(data, null, 2)}</pre>}
      <ApiHandler />
    </div>
  );
}
